INSERT INTO `courses` VALUES (171,'COVID-19 & FIDIC Contracts in Pakistan-A Practical Plan, Session-I ','Cloud Zoom Meeting\n1	INTRODUCTION\n2	AUDIENCE\n3	IS COVID-19 A FORCE MAJEURE / EXCEPTIONAL EVENT UNDER FIDIC?\n3.1	What does the audience say?\n3.2	What is force majeure?\n3.3	Conditions of Contract\n3.3.1	Different FIDIC\'s \n3.3.2	Definition	\n3.3.3	Notice\n3.3.4	Duty to Minimize Delay\n3.3.5	Entitlement\n4	SUMMARY\n5	QUESTION SESSION\n',1,NULL,'2020-06-01 09:23:41','2020-08-07 13:03:58','uploads/2020-08-04T11-37-37.237ZCovidd.png',NULL,NULL,'https://www.youtube.com/watch?v=i0KoOxF1cmw&t=16s',0,'uploads/2020-08-04T11-37-37.320Zcovid-19-2.png',NULL,NULL),(172,'COVID-19 & FIDIC Contracts in Pakistan-A Practical Plan, Session-II','Cloud Zoom Meeting\n1	INTRODUCTION\n2	SUMMARY OF THE FIRST SESSION\n3	ALTERNATIVES ENTITLEMENTS TO FM\n3.1	Contractual Entitlements\n3.2	Legal Entitlements\n4	MANAGEMENT OF THE CLAIM\n4.1	Notices\n4.2	Documentation\n4.3	Formal approach\n4.4	Innovative approach\n5	SUMMARY\n6	QUESTIONS &ANSWERS',1,NULL,'2020-06-01 09:33:59','2020-08-07 13:05:39','uploads/2020-08-04T11-37-05.754Zcovid-19-2.png',NULL,NULL,'https://www.youtube.com/watch?v=BgZt7Wj2tZ8',0,'uploads/2020-08-04T11-37-05.836Zcovid 19.jpg',NULL,NULL),(173,'Cyber Security','Cloud Zoom Meeting\nCyber Security is the practice of protecting systems, networks, and \nprograms from malware and cyber attacks.These cyber attacks are usually aimed at accessing, changing, or destroying sensitive information. Extorting money from users; or interrupting normal business operations.Every organization, big or small, public or private, profit or non-profit- is vulnerable to data and network breaches. \nMost organizations don’t know where they are most vulnerable, \nwho has access to their data, or whether their network security meet legal standards for prudent reasonable safeguards. In this workshop, we will discuss:\n\n1) What organizations can do to increase cyber readiness regarding security and risk management.\n2) What is Information security management system.\n3) What are the common areas of exposure and how to asset security.\n3) How to improve breach response with identity and access management.\n4) What are the new possible threats, their types and precautionary step.\n5) Practical approaches along with examples in different environments.\n',1,NULL,'2020-06-01 09:49:31','2020-09-22 16:20:42','uploads/2020-09-22T16-20-42.729Zcyber-security-1.png',NULL,NULL,'https://www.youtube.com/watch?v=Muu2tIKq5L0&t=13s',0,'uploads/2020-08-04T11-36-38.933Zbanner-2.jpg',NULL,NULL),(174,'Managing Stress for Enhanced Performance','Cloud Zoom Meeting\n1)	Understanding stress and its main causes;\n2)	Understanding stressors and conditions that lead to stress;\n3)	Learn what lifestyle elements can be changed to reduce stress;\n4)	Learn environmental and physical relaxation techniques;\n5)	Identifying the impact of stress on the job performance;\n6)	Learning copes up strategies in order to minimize or eliminate the stress and increase job performance\n',1,NULL,'2020-06-01 10:19:01','2020-07-09 09:14:38','uploads2020-07-09T09-14-38.362ZWhatsApp Image 2020-06-02 at 12.56.22 PM.jpeg',NULL,NULL,'pec.gov.pk',0,'uploads2020-06-30T19-09-16.759ZWhatsApp Image 2020-06-02 at 12.56.22 PM.jpeg',NULL,NULL),(226,'Project Procurement & Contract Management','Project Procurement and Contract Administration is one of the major areas of project management in all Engineering fields. The selection of appropriate project procurement method and exhaustive procurement documentation is critical to the success of all Engineering projects. However, in most of the Engineering and Construction projects, the lack of requisite expertise with the project managers and Engineers leads to project delays and cost overruns. This Webinar on project procurement management and contract administration is thus aimed bridging the gap between the theory and real practice in the Engineering Project management.\nThe course is designed to promote state-of-the-art construction management techniques and practices. It will help to identify problems of local industry, suggest remedial techniques and create awareness among managers, contractors, consultants, government agencies, development organization and academia.\nSpecifically, the course will emphasize on:\n-> To get the basic understanding of the Project procurement generic process.\n-> To familiarize the participants with the modern project management and procurement techniques\n-> To provide details of the Public Procurement Rules and their pitfalls. The strengths and Weaknesses of the rules\nshall be elaborated.\n-> To improve understanding of systematic price indexation and adjustments procedure. in view of the inflationary trends in the economy.',2,NULL,'2020-07-09 09:18:55','2020-09-01 12:59:37','uploads2020-07-09T09-18-55.401ZProject-procuremnet-and-contract-mgt.jpg',NULL,'https://drive.google.com/drive/folders/19kNVlOiaZZSHaVRyZ7WREDpHHPeOY7Y3?usp=sharing','https://drive.google.com/drive/folders/19kNVlOiaZZSHaVRyZ7WREDpHHPeOY7Y3?usp=sharing',1,'uploads2020-07-09T09-18-55.402Zbanner-5.jpg',NULL,NULL),(227,'Engineering Approach During Pandemic to Cater Emerging Needs','A webinar about the approach engineers must adopt to cater emerging needs.',2,NULL,'2020-07-09 09:26:21','2020-09-01 12:57:21','uploads/2020-08-04T11-36-13.980ZEngineering-Approach-during-Pandemic-to-cater-emerging-needs-3.jpg',NULL,'https://drive.google.com/drive/folders/1Ps4HYzKu_WSJdvTZjWsKI6aeikzFI1L2?usp=sharing','https://drive.google.com/drive/folders/1Ps4HYzKu_WSJdvTZjWsKI6aeikzFI1L2?usp=sharing',1,'uploads2020-07-09T09-26-22.206Zbanner-3.jpg',NULL,NULL),(228,'Naya webinarAAA','12123123123',NULL,NULL,'2020-07-22 14:06:07','2020-07-26 13:33:55','uploads2020-07-22T14-06-09.756ZCanIUseThisImage-Blog.png',NULL,NULL,'google.com',-1,'uploads2020-07-22T14-06-09.910ZCanIUseThisImage-Blog.png',NULL,NULL),(229,'Test after protecting routes','aaaa',NULL,NULL,'2020-07-26 14:43:43',NULL,'uploads2020-07-26T14-43-43.381ZIMG_20190207_000753_511.jpg',NULL,NULL,'aaa.com',-1,'uploads2020-07-26T14-43-43.385ZIMG_20190207_000753_511.jpg',NULL,NULL),(230,'Factor Affecting the Performance of R.O. (Reverse Osmosis) Plant','1.	Basic Definitions\n2.	Water Chemistry\n3.	Pre-treatment Options\n4.	Desalination Technologies & Filtration Processes\n5.	How Reverse Osmosis Works\n6.	Factors Influencing R.O. Performance\n7.	Membranes Cleaning',NULL,NULL,'2020-08-11 10:21:07',NULL,'uploads/2020-08-11T10-21-07.499ZThumb-Osmosis.jpg',NULL,NULL,'pec.gov.pk',0,'uploads/2020-08-11T10-21-07.578ZBanner-Osmosis.jpg',NULL,NULL),(231,'Factor Affecting the Performance of R.O. (Reverse Osmosis) Plant','Contents:\n1.	Basic Definitions\n2.	Water Chemistry\n3.	Pre-treatment Options\n4.	Desalination Technologies & Filtration Processes\n5.	How Reverse Osmosis Works\n6.	Factors Influencing R.O. Performance\n7.	Membranes Cleaning',2,NULL,'2020-08-11 10:27:05','2020-09-01 12:58:20','uploads/2020-08-11T10-27-05.859ZThumb-Osmosis.jpg',NULL,'https://drive.google.com/drive/folders/1hGOOcMrYgofZ0UPRvACCtUbSrdnCE4S9?usp=sharing','https://drive.google.com/drive/folders/1hGOOcMrYgofZ0UPRvACCtUbSrdnCE4S9?usp=sharing',1,'uploads/2020-08-11T10-27-06.194ZBanner-Osmosis.jpg',NULL,NULL),(234,'CAM for Designers: A Path to Better Designs','Content of Webinar:\n1.	Introduction to 2.5 Axis CAM\n2.	Technology Data Base\n3.	Automatic feature Recognition\n4.	Interactive feature Recognition\n5.	Pocket features\n6.	Contain and Avoid Areas\n7.	Hole features\n8.	Fillet and chamfer features',2,NULL,'2020-08-13 08:27:07','2020-08-13 09:12:35','uploads/2020-08-13T08-29-56.294Zthumb-CAD.jpg',NULL,'uploads/Cam For Designers A Path To Better Designs-1.m4v','https://www.pec.org.pk/cpd_sCourses_Upcoming_PEBs_test.aspx',1,'uploads/2020-08-13T09-12-35.729Z4.jpg',NULL,NULL),(235,'Investment Casting Process & Technology','Content of Webinar:\n•	Introduction to investment casting\n•	Equipment and consumables\n•	Part manufacturing and consulting\n•	Types\n•	Pros & cons\n•	Process, Technology and inspection.\n',2,NULL,'2020-08-13 08:33:30','2020-08-13 09:12:57','uploads/2020-08-13T08-45-45.990ZIC-Thumb-1.jpg',NULL,'uploads/Webinar on Investment Casting Process & Technology.mp4','https://www.pec.org.pk/cpd_sCourses_Upcoming_PEBs_test.aspx',1,'uploads/2020-08-13T09-12-58.044Z2.jpg',NULL,NULL),(236,'3D Printing with SLA Technology','•	The Development of 3D printing\n•	What SL Users can get benefit from Technology\n•	UnionTech Products and Solution\n•	3D Printing Applications\n',2,NULL,'2020-08-13 08:36:25','2020-08-13 09:13:22','uploads/2020-08-13T08-36-25.118ZThumb-3D-printing.jpg',NULL,'uploads/3D printing .mp4','https://www.pec.org.pk/cpd_sCourses_Upcoming_PEBs_test.aspx',1,'uploads/2020-08-13T09-13-22.673Z1.jpg',NULL,NULL),(237,'Improve Your Design Skills With SOLIDWORKS','During this webinar we will be discussing industrial design challenges using a 3D CAD design with real life case of Drilling Rig use to Drill Mechanical rocks & bolt screening to the walls ceiling to ensure safety in underground mines. We will also run virtual simulation tests to make sure the design must not fail in real world environment.\n\nJoin us in this webinar to eliminate design faults in complex assembly modeling. We will show in deep details various modeling techniques, generation of 2D Drawings including BOMs and validate design using virtual prototyping\n',2,NULL,'2020-08-13 08:38:07','2020-08-13 09:13:35','uploads/2020-08-13T08-38-07.463ZThumb-Solidworks.jpg',NULL,'uploads/improve Your Design Skills With Solidworks.mp4','https://www.pec.org.pk/cpd_sCourses_Upcoming_PEBs_test.aspx',1,'uploads/2020-08-13T09-13-36.055Z3.jpg',NULL,NULL),(238,'Test for Iframe','This is a test webinar for iframe',NULL,NULL,'2020-08-18 06:51:37',NULL,'uploads/2020-08-18T06-51-37.395Z17933624.jpg',NULL,NULL,'http://cpd.pec.org.pk/webinartest',-1,'uploads/2020-08-18T06-51-43.154Z17933624.jpg',NULL,NULL),(239