INSERT INTO `userinfo` VALUES (1,NULL,'123',3,'Tayyab Naveed','tayyabnaveedrajput@gmail.com','xyz','051-5589323','1993-02-01',NULL,'12345','Codistan',0.0,'2011-10-10',NULL,'example','Developer',NULL,NULL,NULL,NULL,'Active',NULL),(2,NULL,'123',2,'Christiaan Grosskopf','xyz.com','xyz','090078601','1980-01-01',NULL,'12312123','PEC',0.0,'2005-01-01',NULL,'123','Reknowned Engineer',NULL,NULL,NULL,NULL,'Active',NULL),(3,NULL,'123',2,'Engr. Dr. Asad Arfeen','abc.com','xyz','051-1111111','1980-01-01',NULL,'121212','PEC',0.0,'2005-01-01',NULL,'15','Engr. Dr. Asad Arfeen is an Assistant Professor at the Department of Computer and Information Systems Engineering of NED University of Engineering \\& Technology, Karachi Pakistan and Director of National Center for Cyber Security. He completed his PhD from University of Canterbury New Zealand in 2015. He has been holder of REANNZ PlanetLab New Zealand scholarship and Battersby Trimble award for advancement of computing in New Zealand. As Principal Investigator Dr. Asad has won various competitive research grants from Higher Education Commission of Pakistan. He has also won 118 million PKR competitive research grant for establishing National Research Centre for Cyber Security in Pakistan. He is also currently heading IT department and Network Operations Centre of NED University of Engineering \\& Technology, Karachi, Pakistan. Dr. Asad has extensive research collaborations with WAND research group of University of Waikato, New Zealand and DFKI German research centre for Artificial Intelligence. He has also served as the Advisor to the IGP Sindh. ',NULL,NULL,NULL,NULL,'Active',NULL),(4,NULL,'12',2,'Engr. Dr. Naveed Ramzan','zzz.com','xyz','051-3333333','1980-01-01','userphotos/naveedramazan.png','12121','PEC',0.0,'2005-01-01',NULL,'1234','Dean Faculty of Chemical, Polymer, and Metallurgical Engineering, UET Lahore\nChairman Dept of Chemical Engineering (2016-2019)\nCampus Coordinator of UET Faisalabad Campus (2013-2016)\nConvener Procurement Cell UET Lahore \n PhD in Process System Engineering Modelling (BTU Germany)\nNEBOSH IGC Uk, IOSH Approved Tutor \n Resource Person CPD Trainer PEC\nResource Person PDC, UET Lahore \nResource Person SBS \nVisiting Faculty PIRT \nResearch Publications 115\nIF>65  Total Citations > 1065 H-Index = 24 MSc Thesis Supervised > 95 PhD =7 \nBook Contributions 4 \nProfessional Trainings Conducted > 500\n',NULL,NULL,NULL,NULL,'Active',NULL),(5,NULL,'151',2,'Engr. Dr. Attaullah Shah','sdf.com','xyz','051-2323232','1980-01-01','userphotos/attaullahshah.png','15151','PEC',0.0,'2005-01-01',NULL,'987','PhD Civil Engineering, M Phil Eco, MS Civil Engg, MS Envir Design, MBA, MA Eco, BS Civil Engg. (Gold Medal), Post Grad Diploma Comp Sc.(Gold Medal) \nApproved PhD Supervisor (Civil Engineering) Fellow Institute of Engineers Pakistan Life Member Pakistan Engineering Council Member editorial board of International journals of Engineering and Management   Dr. Attaullah Shah is a leading researcher, educator and practitioner with 32 year senior/executive     level diverse experience in the fields of academic leadership, project design and management, teaching and research, public connectivity and high performance team in higher education across public and private sectors. He has been involved in connectivity with first grade think-tanks and policy makers nationally and internationally to frame dynamic strategies for implementing result  driven policies across Pakistan and several other countries. Besides PhD in Civil Engineering, Dr. Shah, has also done MPhil in Eco, MBA and MS Environmental design, PGD Computer Science. Dr. Shah is the author of more than 100 research publications in international refereed journal and conferences. He authored 6 books. His current research is focused on Academic  and Research Leadership, project risk management, sustainability in Built Environment.  He is Life Member of Pakistan Engineering Council, Consulting Engineer, Vice Chairman Institut